import React, {Component} from "react";
import '../tabata.css';
import Form from 'react-bootstrap/Form'

class Exercise extends Component {
    render() {
        return(
                <div className="text-center col-10">
                    <h1>Tu Tabata</h1>
                    <div className="card-body">
                        <h4 className="card-title border-info">Vueltas</h4>
                        <Form.Group controlId="exampleForm.ControlSelect1">
                            <Form.Label>Example select</Form.Label>
                            <Form.Control as="select">
                              <option>1</option>
                              <option>2</option>
                              <option>3</option>
                              <option>4</option>
                              <option>5</option>
                            </Form.Control>
                          </Form.Group>
                    </div>
                    <div className="card-body">
                        <h4 className="card-title">Tiempo de descanso:</h4><p>60seg</p>
                        <h4 className="card-title">Tiempo de espera:</h4><p>10seg</p>
                    </div>
                </div>
        );
    }
}

export default Exercise;
